import React from "react";
import "./intro.css";
import profilePic from "../../../resources/pic/joey.JPG";

const Intro = () => {
  return (
    <div id="about">
      <div class="row bio-container">
        <div class="twelve columns bio-inner">
          <div class="six columns bio-left">
            <div class="pp-container">
              <img
                class="profile-pic wow zoomIn"
                src="profilePic"
                alt="Ahmed Soliman"
              />
              <h2>Ahmed Soliman</h2>
              <h3>Senior Full-Stack Software Developer</h3>
            </div>
          </div>

          <div class="six columns main-col wow fadeIn">
            <div class="arrow-left"></div>
            <p>
              I'm a responsive full stack developer currently living in San
              Francisco, CA. love making cool stuff, Iâ€™m curious, and I enjoy
              work that challenges me to learn something new and stretch in a
              different direction. I do my best to stay on top of changes in the
              state of the art so that I can meet challenges with tools well
              suited to the job at hand. I am both driven and self-motivated,
              and I am constantly experimenting with new technologies and
              techniques. I am very passionate about Web Development and strive
              to better myself as a developer.
            </p>

            <div class="row">
              <div class="six columns download">
                <p>
                  <a href="#contact" class="button">
                    <i class="fa fa-paper-plane"></i>Hire Me
                  </a>
                  <a href="resume.pdf" class="button" target="_blank">
                    <i class="fa fa-download"></i>Download Resume
                  </a>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Intro;

